import '../../css/components/chat_group/newChannelForm.scss'

function NewChannelForm() {
  return (
    <div className='new-channel-container'>

      <div className="title">
        <h3>New channel</h3>
        <input className='input name' type='text' />
      </div>

    </div>
  )
}

export default NewChannelForm
